                    <Route path="/myPage">
                        <Header />
                        <MyPageTop />
                        <ReservationCheckTop />
                    </Route>
                    <Route path="/">
                        <Header />
                        <MainTop />
                    </Route>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
